import React from "react";
import {Router, Route, Switch} from "react-router-dom";

import HomePage from "./HomePage";
import OrderPage from "./OrderPage";
import CheckoutPage from "./CheckoutPage";
import MealsPage from "./MealsPage";
import SidesPage from "./SidesPage";
import DrinksPage from "./DrinksPage";
import DessertsPage from "./DessertsPage";
import BasicItemPage from "./BasicItemPage";
import Footer from "./Footer";
import history from "../history";

const App = () => {
    return(
      <div>
        <Router history={history}>
          <Switch>
            <Route path="/" exact component={HomePage} />
            <Route path="/order" exact component={OrderPage} />
            <Route path="/checkout" exact component={CheckoutPage} />
            <Route path="/meals" exact component={MealsPage} />
            <Route path="/sides" exact component={SidesPage} />
            <Route path="/drinks" exact component={DrinksPage} />
            <Route path="/desserts" exact component={DessertsPage} />
            <Route path="/menu_item" exact component={BasicItemPage} />
          </Switch>
        </Router>
      </div>
    );
}

export default App;
